import Navbar from './components/Navbar';
import { BrowserRouter as Router,  Route } from 'react-router-dom';
import React from 'react';
import './App.css';

function App() {
  return (
    <>
      <Router>
        <Navbar /> 
        <>
          <Route path='/' exact />
        </>
      </Router>
    </>
  );
}

export default App;
